import './App.css';
import React, { Component } from 'react';
import blue from './dotColors/blue.png'
import red from './dotColors/red.png'

class App extends Component {
  state = { dots: [{color: "blue", x: 20, y: 20}, {color: "red", x: 0, y: 0}] }

  dotPositions = (dots) => {
    var dict = {blue: "https://www.mikeball.com/wp-content/uploads/2016/03/blue-dot.png", red: "https://upload.wikimedia.org/wikipedia/commons/0/0e/Basic_red_dot.png"};
    const dotMap = dots.map((dot) =>
      <img src={dict[dot.color]} width="15px" height="15px" style={{position: "absolute", left: dot.x, top: dot.y}}/>
    );
    return dotMap
  }

  render() { 

    const dotPos = this.dotPositions(this.state.dots)
    console.log(dotPos)
    return (
      <div>
        <img src="https://i.redd.it/ldfi6xzs56t51.png" width="80%" height="auto" />

        {dotPos}
      </div>
    )
  }
}

export default App;
